import React from 'react';
import './Menu.css';

const title = <h1>JUATABOT</h1>;
const contact_email = <p class="contact" >tan.hen@husky.neu.edu</p>;


function Menu() {
  return (
    <div class="menuColumn">
      {title}
      <div class="contactInfo">
        <ContactLink link="https://instagram.com/juatabot"></ContactLink>
        <ContactLink link="mailto: tan.hen@husky.neu.edu"></ContactLink>
      </div>

    </div>
  )
}

function ContactLink(props) {
  return (
    <a href={props.link} target="_blank" class="contact-link">{props.link}</a>
  )
}

export default Menu;
